import React from "react";
import { Redirect, Switch } from "react-router-dom";
import { ConfigurePage } from "./configure/ConfigurePage";
import { ProductPage } from "./product/ProductPage";
import { DepotPage } from "./depot/DepotPage";
import { ContentRoute } from "../../../_metronic/layout";

export default function Inventory() {
  return (
    <Switch>
      <Redirect
        exact={true}
        from="/inventory"
        to="/inventory/configure/product-configure"
      />
      {/* Inputs */}
      <ContentRoute from="/inventory/configure" component={ConfigurePage} />
      <ContentRoute from="/inventory/product" component={ProductPage} />
      <ContentRoute from="/inventory/depot" component={DepotPage} />
    </Switch>
  );
}
